import axios, {AxiosResponse} from 'axios'
import {error} from 'console';
import React from 'react'
import {User} from './User'

interface IProps{

}
interface IState{
users:User[]

}
class UserList extends React.Component<IProps,IState>
{

    constructor(props:IProps)
    {
        super(props);
        this.state={
            users:[] as User[]
        }
        
    }
componentDidMount():void
{
    let dataURL:string='https://jsonplaceholder.typicode.com/users';

axios.get(dataURL).then((response:AxiosResponse<any>)=>
{
this.setState(
    {
        users:response.data
    }
)
}).catch((error)=>
{
    console.error(error)
})
}   
    

render()
{
    
return(

<React.Fragment>
<section className='mt-3'>
<div className='container'>
    <div className='row'>
    <div className='col'>
        <h2>User Data</h2>
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Temporibus molestiae commodi nam laborum labore facilis maxime mollitia asperiores ab quis sapiente, inventore modi aut corrupti aliquid dolore, architecto, quas nihil?</p>
    </div>
     </div>
     </div>
</section>
<section className='mt-3'>
    <div className='container'>
        <div className='row'>
            <div className='col'>
                <table className='table table-hover text-center table-striped bg-primary'>
                    <thead className='bg-secondary'>
                    <tr><th>SNo.</th>
                        <th>UserName</th>
                        <th>Email</th>
                        <th>Address</th>
                        <th>ContactNo.</th>
                        <th>Website</th>
                    </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.users.map((user)=>
                            {
                                return(
                                <tr>
                                <td>{user.id}</td>
                                <td>{user.name}</td>
                                <td>{user.email}</td>
                                <td>{user.address.city}</td>
                                <td>{user.phone}</td>
                                <td>{user.website}</td>
                            </tr>
                            )
                        }
                            )}
                    </tbody>
                </table>
            </div>
        </div>
    </div>

</section>
</React.Fragment>
)
}
}
export default UserList
